svg.script:
  var intro=document.getElementById("intro");
  intro.addEventListener("click",start);
  var gameOver=document.getElementById("gameOver");
  gameOver.addEventListener("click",restart);
  var w=1920,h=1070,score=0, gameover=false;
  var sfx_ids=["hit_wall","shoot0","shoot1","shoot2","shoot3","shoot4","explo","loose","bounce1","bounce2","bounce3","bounce4","bounce5","bounce6"];
  var sfx={};
  for(var i=sfx_ids.length-1;i>=0;i--)
  {
	var dom=document.getElementById("sfx_"+sfx_ids[i]);
	if(dom==null)
	{
		console.log("warning, missing sound fx: "+"sfx_"+sfx_ids[i]);
	}
	sfx[sfx_ids[i]]=dom;
  }
  for(var i=3;i>=0;i--)
  {
	sfx["shoot"+i].innerHTML=sfx["shoot4"].innerHTML;
  }
  var shooter={x:w/4,y:h-100,dom: document.getElementById("shooter"),shootTimeout:0,speed:0};
  var ball={x:w/2,y:-100,dom: document.getElementById("ball"),dx:0,dy:0,r:60,points:1};
  var knal={x:w/2,y:h/2,dom: document.getElementById("knal"),visible:false,r:0,max:0};
  ball.text=ball.dom.getElementsByTagName("text")[0];
  var bullets=[];
  for(var i=4;i>=0;i--)
  {
    bullets.push( {visible:false,dom: document.getElementById("b"+i)});
  }
  bullet_nr=0;
  var keys=[];
  document.addEventListener("keydown",handleKeys);
  document.addEventListener("keyup",handleKeys);

  function start()
  {
    intro.style="display: none";
    // we need to play the shoot sound on first click, to be able to play sound in the game.
    playSfx("hit_wall");
    // start the game..
	document.getElementById("score").innerHTML="Score:"+score;
      gameLoop();
  }
  function restart()
  {
    gameOver.style.display="none";
    gameover=false;
    ball.x=w/2;
    ball.y=-100;
    ball.dx=0;
    ball.dy=0;
    ball.points=1;
    ball.text.innerHTML=ball.points;
    shooter.x=w/4;
    shooter.y=h-100;
    shooter.speed=0;
	score=0;
	document.getElementById("score").innerHTML="Score:"+score;
  }
  function gameLoop()
  {
    moveShooter();
    moveKnal();
    moveBullets();
    moveBall(ball);
    window.requestAnimationFrame(gameLoop);
  }
  function createBullet()
  {
    var b=bullets[bullet_nr];
    bullet_nr=(bullet_nr+1)%5;
    b.x=shooter.x;
    b.y=shooter.y;
    b.visible=true;
    var rad=shooter.hoek/180*Math.PI;
    b.dx=Math.sin(rad)*20;
    b.dy=-Math.cos(rad)*20;
    b.hoek=shooter.hoek;
  }
  function moveKnal()
  {
    if(knal.visible==true)
    {
      knal.s++;
      knal.dom.setAttribute("transform","translate("+knal.x+","+knal.y+") scale("+knal.s/100+","+knal.s/100+") rotate("+knal.r+")");
      knal.dom.setAttribute("stroke-opacity",1-knal.s/100);
      knal.dom.style.display="";
      if(knal.s/100>1)
      {
        knal.visible=false;
      }
    }else
    {
      knal.dom.style.display="none";
    }
  }
  function createKnal(x,y,max)
  {
    knal.x=x;
    knal.y=y;
    knal.r=-25+Math.random()*50;
    knal.s=20;
    knal.visible=true;
    knal.max=max;
  }
  function moveBullets()
  {
    for(var i=bullets.length-1;i>=0;i--)
    {
     var b=bullets[i];
     b.y+=b.dy;
     b.x+=b.dx;
     if(b.y>0)
     {

     }else
     {
        b.visible=false
     }
     if(b.visible)
     {
        b.dom.setAttribute("transform","translate("+b.x+","+b.y+") rotate("+b.hoek+")");
        b.dom.style.display="";
       // check hit ball
       var dx=b.x-ball.x;
       var dy=b.y-ball.y;
       var len=Math.sqrt(dx*dx*2+dy*dy);
       if(len>100)
       {}else{
         createKnal((b.x+ball.x)/2,(b.y+ball.y)/2,2);
         b.visible=false;
         ball.points++;
		 if(ball.points>=6) 
		 {
			ball.points=6;
			ball.dom.setAttribute("filter","url(#bullet)");
		 }
		 playSfx("bounce"+ball.points);
         score+=ball.points;
         document.getElementById("score").innerHTML="Score:"+score;
         ball.text.innerHTML=ball.points;
         ball.dx+=b.dx-15*dx/len;
         ball.dy+=b.dy;
       }
     }else
     {
        b.dom.style.display="none";
     }
    }
  }
  function playSfx(id) {
    var audio = sfx[id];
    if (audio.paused) {
        audio.play();
    }else{
        audio.pause();
        audio.currentTime = 0
    }
}
  function moveBall(b)
  {
    b.x+=b.dx;
    var hoek=(960-b.x)/960;
    var ground=1000-138*hoek*hoek;
    b.y+=b.dy;
    if(b.x>1850)
    {
      b.x=1850;
      b.dx=-Math.abs(b.dx);
     playSfx("hit_wall");
    }
    if(b.x>50)
    {}else{
      b.x=50;
      b.dx=Math.abs(b.dx);
     playSfx("hit_wall");
    }
    if(b.y>50)
    {
    }else{
     b.y=50;
     b.dy=Math.abs(b.dy);
     playSfx("hit_wall");
    }
    if(b.y>ground)
    {
      b.y=ground;
	  if(ball.points!=0)
	  {
	   	 playSfx("loose");
	  }else{
       playSfx("hit_wall");
	  }
	  ball.dom.removeAttribute("filter");
      ball.points=0;
      ball.text.innerHTML=ball.points;

      b.dy=-Math.abs(b.dy);
      if(b.dy>-15){b.dy=-15;}
      b.dx+=(960-b.x)/100;
    }
    b.dy+=0.5;
    b.dx*=0.99;
    b.dy*=0.99;
    b.dom.setAttribute("transform","translate("+b.x+","+b.y+")");
    // test if we hit the shooter
    var dx=b.x-shooter.x;
    var dy=b.y-shooter.y;
    var len=Math.sqrt(dx*dx+dy*dy);
    if(len>80){}else{
      if(gameover==false)
	  {
       createKnal(shooter.x,shooter.y,2);
		playSfx("explo");
	  }
      document.getElementById("gameOver").style.display="";// show gameOver..
      gameover=true;
    }
  }
  function moveShooter()
  {
    if(gameover!=true)
    {
      if(keys[37]==true) shooter.speed-=2;
      if(keys[39]==true) shooter.speed+=2;
      shooter.speed*=0.95;
      if(shooter.x>960) shooter.speed-=0.1;
      else shooter.speed+=0.1;
      shooter.x+=shooter.speed;

      if(shooter.x>75){
      }else
      {
        shooter.x=75;
        shooter.speed=Math.abs(shooter.speed)*0.5;
      }
      if(shooter.x>1845){
        shooter.x=1845;
        shooter.speed=-Math.abs(shooter.speed)*0.5;
      }
      if(shooter.shootTimeout>0) shooter.shootTimeout--;

      if(shooter.shootTimeout==0)
      {
        if(keys[32]==true)
        {
          playSfx("shoot"+bullet_nr);
          // shoot.
          createBullet();
          shooter.shootTimeout=10;
        }
      }
      var hoek=(960-shooter.x)/960;
      shooter.hoek=hoek*18;
      shooter.y=955-138*hoek*hoek;
      shooter.dom.setAttribute("transform","translate("+shooter.x+","+shooter.y+") rotate("+shooter.hoek+")");
      shooter.dom.style.display="";
    }else
    {
        shooter.dom.style.display="none";// game over, so NO shooter anymore..

    }
  }
  function handleKeys(ev)
  {
    var key = ev.keyCode || ev.which;
    if(ev.type=="keydown")
    {
      keys[key]=true;
    }else
    {
      keys[key]=false;
    }
  }
